INSERT INTO routes (id, name, description, gpx_coordinates, level, author_id)
VALUES (1, 'Хижа Ком - Творчески дом Петрохан',
        'Името „Ком“ носят 2 туристически хижи - нова и стара, в Берковския Балкан, в подножието на един от високите върхове на Стара планина - Ком. И двете хижи са двуетажни, електрифицирани и водоснабдени. Двете хижи служат за отправна точка при покоряване на българската част от европейския туристически маршрут Е-3, известна още като маршрут „Ком - Емине“.
    Новата хижа „Ком“ се намира в местността Горна кория, на надморска височина 1506 м. Сградата ѝ е масивна, с капацитет 120 места. Хижата е с централно отопление, половината стаи са с общ санитарен възел на етажа, а другата половина - със самостоятелни възли. Разполага с ресторант, туристическа кухня и столова.',
        '<?xml version="1.0" ?><gpx creator="GaiaGPS" version="1.1" xmlns="http://www.topografix.com/GPX/1/1" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xsi:schemaLocation="http://www.topografix.com/GPX/1/1 http://www.topografix.com/GPX/1/1/gpx.xsd"><rte><name>Ден 1 х.Ком(нова) -&gt; ТД Петрохан </name><desc>Творческа къща Петрохан (1450 м. н.в.) се намира на връхната точка на прохода Петрохан по маршрута Ком-Емине. След като се пресече основното шосе на прохода се продължава по по-малък асфалтов път в посока мраморната чешма и бившата х. Петрохан. От ляво се разполага водното огледало на язовир-изравнителя на ВЕЦ Петрохан, а Творческата къща остава от дясно на пътя. Представлява масивна триетажна сграда с голяма столова. Предлага настаняване целогодишно. Изхранването е само с предварителна заявка. С предварителна уговорка с домакините може да се приготви и сух пакет с хранителни провизии и да се пусне пералня.
    //творчески дом - 0876 965 311; 0884 027 130</desc><extensions><line xmlns="http://www.topografix.com/GPX/gpx_style/0/2"><color>5E7A8C</color></line></extensions><rtept lat="43.189377" lon="23.080559"><ele>1518.7253892799954</ele></rtept><rtept lat="43.189285" lon="23.080467"><ele>1520.0408000000245</ele></rtept><rtept lat="43.189232" lon="23.080364"><ele>1520.984000000035</ele></rtept><rtept lat="43.189232" lon="23.080172"><ele>1522.347235840027</ele></rtept><rtept lat="43.189293" lon="23.079994"><ele>1523.292705280025</ele></rtept><rtept lat="43.189411" lon="23.079674"><ele>1525.8102985599944</ele></rtept><rtept lat="43.189507" lon="23.079411"><ele>1527.1207140800311</ele></rtept><rtept lat="43.189548" lon="23.079088"><ele>1527.1952230399418</ele></rtept><rtept lat="43.189522" lon="23.078938"><ele>1528.3597625601046</ele></rtept><rtept lat="43.189468" lon="23.07881"><ele>1530.2608832000635</ele></rtept><rtept lat="43.18937" lon="23.078691"><ele>1532.4170768000617</ele></rtept><rtept lat="43.189255" lon="23.078586"><ele>1534.2250415999617</ele></rtept><rtept lat="43.189259" lon="23.078476"><ele>1533.3638380799907</ele></rtept><rtept lat="43.189293" lon="23.078283"><ele>1532.0904000000053</ele></rtept><rtept lat="43.187704" lon="23.077852"><ele>1560.407536640019</ele></rtept><rtept lat="43.186753" lon="23.077739"><ele>1578.4988246399403</ele></rtept><rtept lat="43.186292" lon="23.077602"><ele>1586.8460825599868</ele></rtept><rtept lat="43.185992" lon="23.07745"><ele>1595.9272320000482</ele></rtept><rtept lat="43.185038" lon="23.076715"><ele>1621.3545968000094</ele></rtept><rtept lat="43.184162" lon="23.07622"><ele>1647.465600000006</ele></rtept><rtept lat="43.183662" lon="23.076087"><ele>1653.9234947199989</ele></rtept><rtept lat="43.183255" lon="23.076131"><ele>1656.3962087999687</ele></rtept><rtept lat="43.181957" lon="23.076483"><ele>1675.4557724801286</ele></rtept><rtept lat="43.181562" lon="23.076483"><ele>1690.0007401600215</ele></rtept><rtept lat="43.1814