INSERT INTO routes (id, name, description, gpx_coordinates, level, author_id)
VALUES (5, 'проход Витиня - хижа Кашана',
        'Хижа "Кашана" се намира в Стара планина на 1340м н.в., близо до Етрополе. До нея може да се стигне по асфалтов път. Състои се от 3 бунгала и една масивна двуеатжна сграда. Общия капацитет е 44 места. Голямата сграда има общи вътрешни санитарни възли и баня. Хижата е водоснабдена и електрифицирана. За бунгалата санитарните възли и умивалните са външни. Отопляват се с печки на твърдо гориво. Хижата е пункт от европейски маршрут E3 (Ком - Емине).',
