INSERT INTO routes (id, name, description, gpx_coordinates, level, author_id)
VALUES (7, 'Момина поляна - хижа Козя стена',
        'Местоположение на хижа Козя стена: Троянска планина, м. Хайдук чешма,1536мн.в., GPS: 42.785073ºN 24.529065ºE
Описание: Сграда с капацитет 100 места в два апартамента и в стаи с 2-8 легла, етажни санитарни възли и бани, собственно ел. захранване, отопление с печки на твърдо гориво, туристическа столова и кухня, бюфет, павилион, зала с аудио и видеотехника.
Хижата е пункт от „Е-3”.
Изходни пунктове: връхната точка на Троянския проход – 2.30ч, с. Христо Даново, общ. Карлово (спирка на Подбалканската ж.п. линия) – 5ч; с. Розино (спирка на Подбалканската ж.п. линия) – 5ч, х. Хайдушка песен – 2.30ч, с. Чифлик, общ. Троян (през х. Хайдушка песен) – 3.30ч
Съседни обекти: х. „Ехо“ – 2.20ч, х. Васильов (през вр. Ушите) – 6ч, х. Дерменка – 4.40ч, скален феномен „Гъбата” – 0.45ч, вр. Козя стена (1670 м) – 1.30ч.',
